import React from 'react'
import {Link,Outlet} from'react-router-dom';
import './NabarStyles.css'
const Dashboard = ()=> {
    return(
    <div>
        <div>
            <ul>
                <li><Link to="/dashboard/create">Create</Link></li>
                <li><Link to="/dashboard/view">View</Link></li>
                <li><Link to="/dashboard/update">Update</Link></li>

            </ul>
        
        </div>
        <Outlet/>
    </div>
    );
    
}
export default Dashboard
